import React, { useEffect, useState } from 'react';
import DesktopShortcut from './DesktopShortcut';
import Toolbar from './Toolbar';
import ShutdownSequence from './ShutdownSequence';
import Colors from '../../constants/Colors';

interface Shortcut {
    icon: string;
    shortcutName: string;
    onOpen: () => void;
}

interface DesktopProps {
    shortcuts: Shortcut[];
    windows: {
        [key: string]: {
            component: React.ReactElement;
            zIndex: number;
            minimized: boolean;
        };
    };
    onWindowInteract: (key: string) => void;
    removeWindow: (key: string) => void;
    toggleMinimize: (key: string) => void;
    startShutdown: () => void;
    shutdown: boolean;
    numShutdowns: number;
}

const Desktop: React.FC<DesktopProps> = ({
                                             shortcuts,
                                             windows,
                                             onWindowInteract,
                                             removeWindow,
                                             toggleMinimize,
                                             startShutdown,
                                             shutdown,
                                             numShutdowns,
                                         }) => {
    const [selection, setSelection] = useState({
        isSelecting: false,
        originX: 0,
        originY: 0,
        startX: 0,
        startY: 0,
        width: 0,
        height: 0,
    });

    const [selectedShortcuts, setSelectedShortcuts] = useState<Set<string>>(new Set());

    const handleMouseDown = (e: React.MouseEvent) => {
        const originX = e.clientX;
        const originY = e.clientY;

        setSelection({
            isSelecting: true,
            originX,
            originY,
            startX: originX,
            startY: originY,
            width: 0,
            height: 0,
        });

        setSelectedShortcuts(new Set()); // сброс выделения
    };

    const handleMouseMove = (e: React.MouseEvent) => {
        if (!selection.isSelecting) return;

        const mouseX = e.clientX;
        const mouseY = e.clientY;

        const startX = Math.min(mouseX, selection.originX);
        const startY = Math.min(mouseY, selection.originY);
        const width = Math.abs(mouseX - selection.originX);
        const height = Math.abs(mouseY - selection.originY);

        setSelection({
            ...selection,
            startX,
            startY,
            width,
            height,
        });
    };

    const handleMouseUp = () => {
        if (!selection.isSelecting) return;

        const newlySelected = new Set<string>();

        shortcuts.forEach((shortcut: Shortcut, i: number) => {
            const iconX = 6; // left из styles
            const iconY = 16 + i * 104; // top из styles
            const iconW = 64;
            const iconH = 96;

            const selX = selection.startX;
            const selY = selection.startY;
            const selW = selection.width;
            const selH = selection.height;

            const overlap = !(
                iconX + iconW < selX ||
                iconX > selX + selW ||
                iconY + iconH < selY ||
                iconY > selY + selH
            );

            if (overlap) {
                newlySelected.add(shortcut.shortcutName);
            }
        });

        setSelectedShortcuts(newlySelected);

        setSelection({
            isSelecting: false,
            originX: 0,
            originY: 0,
            startX: 0,
            startY: 0,
            width: 0,
            height: 0,
        });
    };

    return !shutdown ? (
        <div
            style={styles.desktop}
            onMouseDown={handleMouseDown}
            onMouseMove={handleMouseMove}
            onMouseUp={handleMouseUp}
        >
            {/* Render windows */}
            {Object.keys(windows).map((key) => {
                const element = windows[key].component;
                if (!element) return <div key={`win-${key}`}></div>;
                return (
                    <div
                        key={`win-${key}`}
                        style={{
                            zIndex: windows[key].zIndex,
                            ...(windows[key].minimized && styles.minimized),
                        }}
                    >
                        {React.cloneElement(element, {
                            key,
                            onInteract: () => onWindowInteract(key),
                            onClose: () => removeWindow(key),
                        })}
                    </div>
                );
            })}

            {/* Render shortcuts */}
            <div style={styles.shortcuts}>
                {shortcuts.map((shortcut: Shortcut, i: number) => (
                    <div
                        style={{ ...styles.shortcutContainer, top: i * 104 }}
                        key={shortcut.shortcutName}
                    >
                        <DesktopShortcut
                            icon={shortcut.icon}
                            shortcutName={shortcut.shortcutName}
                            onOpen={shortcut.onOpen}
                            isSelected={selectedShortcuts.has(shortcut.shortcutName)}
                        />
                    </div>
                ))}
            </div>

            {/* Render selection box */}
            {selection.isSelecting && (
                <div
                    style={{
                        position: 'absolute',
                        left: selection.startX,
                        top: selection.startY,
                        width: selection.width,
                        height: selection.height,
                        backgroundColor: 'rgba(0, 0, 255, 0.3)',
                        border: '2px solid blue',
                        pointerEvents: 'none',
                    }}
                />
            )}

            <Toolbar
                windows={windows}
                toggleMinimize={toggleMinimize}
                shutdown={startShutdown}
            />
        </div>
    ) : (
        <ShutdownSequence setShutdown={startShutdown} numShutdowns={numShutdowns} />
    );
};

const styles: { [key: string]: React.CSSProperties } = {
    desktop: {
        minHeight: '100%',
        flex: 1,
        backgroundColor: Colors.turquoise,
        position: 'relative',
    },
    shutdown: {
        minHeight: '100%',
        flex: 1,
        backgroundColor: '#1d2e2f',
    },
    shortcutContainer: {
        position: 'absolute',
        left: 6,
    },
    shortcuts: {
        position: 'absolute',
        top: 16,
        left: 6,
    },
    minimized: {
        pointerEvents: 'none',
        opacity: 0,
    },
};

export default Desktop;
